Happy Friday! Today the gang dissected three topics - tariffs and tech, software supply chain cyber risks, and AI-powered serendipity. On topic 1 we talked about the impact tariffs are already having on tech, as Acer just announced a pending 10% price increase to offset import fees. What do tariffs mean for Big Tech? Thoughts?

We then talked about the North Korean hacker group The Lazarus Group and how theyâ€™re impeding open source repositories like GitHub with malicious content and code. Developers and organizations need to be much more vigilant, but also, how much responsibility should the repositories have?

Lastly we unpacked AI-powered serendipity and how multimodal machine learning is helping companies like Netflix to surprise and delight you with personalized content. But, is it creepy? IMO the line between delight/relevant content and creepy is dotted. What do you think about AI watching what we watch or listen to?
